<html>
<head>
<style>
.docle_milk{
animation:doclemilk 4s linear 3s infinite alternate ;
}
@keyframes doclemilk{
0%{
	transform:translate(0px, 0px) rotateX(360deg) scale(1.21,1.21);

}
25%{
	transform:translate(1000px, 0px)rotateX(360deg)scale(0.96,0.96);
}
50%{
	transform:translate(1002px, 0px)rotateX(200deg)scale(0.5,0.5);
}
75%{
	transform:translate(0px, 500px)rotateX(200deg)scale(2,2);
}

100%{
	transform:translate(0px, 0px)rotateX(360deg)scale(0.31,0.31);
}
}
.docle_milki{
animation:doclemilk 4s linear 3s infinite alternate ;
}
@keyframes doclemilk{
0%{
	transform:translate(0px, 0px) rotateX(360deg) scale(1.21,1.21);

}
25%{
	transform:translate(1000px, 0px)rotateX(360deg)scale(0.11,0.11);
}
50%{
	transform:translate(1002px, 0px)rotateX(200deg)scale(0.7,0.7);
}
75%{
	transform:translate(0px, 500px)rotateX(200deg)scale(4,6);
}

100%{
	transform:translate(0px, 0px)rotateX(360deg)scale(0.36,0.39);
}
}
.text{animation:tex 5s ease 1s infinite alternate;}
@keyframes tex{
    0%{
	  color:black;
	  font-size:30px);
	  background:black;
	  transform:(01deg,01deg);
	}
  50%{
  color:purple;
  }
  
  100%{
    color:orange;
  }


}
</style>
